If unstable === true, then do not select, if it is equal to false or null, then ignore the filter
The second have condition must be less than max, but only if max !== null otherwise ignore this filter</p>
<p>Also, both of these conditions must pass, i.e. if the record does not match for some condition, then we do not add it to the selection</p>
<p>Everything is clear with the first condition, it's easy to check if unstable !== true, then ignore
